import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Header />
    </div>
  );
}

function Header() {
  return (
    <header className="header">
      <img className="header__logo" src="assets/logo/Logo-brainflix.png" />
      <div className="header__right">
        <input className="search" placeholder="Search..." />
        <p className="lastPressed">+ UPLOAD</p>
        <img className="Mohan" src="/assets/images/Mohan-muruge.jpg" />
      </div>
    </header>
  );
}

export default App;
